import { Typography } from '@mui/material'
import { Box } from '@mui/system'
import React from 'react'

function Footer() {
  return (
        <Box sx={{backgroundColor: 'primary.main',
        width: '100%',
        position: 'fixed',
        bottom: '0px',
        padding: '0.1em'
        }}>
            <Box sx={{
                float: 'right',
                width: 'auto',
            }}>
            <Typography color="secondary.main">
                All rights reserved 2022
            </Typography>
            </Box>
        </Box>
  )
}

export default Footer
